import React from "react";
import GameCard from "../components/GameCard";
import { connect } from "react-redux";
const GamePage = () => {
  return (
    <div className="game-page">
      <GameCard />
    </div>
  );
};

const mapStateToProps = (state) => {
  return state;
};
export default connect(mapStateToProps(GamePage));
